                                <span><?php echo str_ireplace(' ', '</span><span>', get_the_title()); ?></span>
                            </div>
                            <?php $phone = get_field('phone'); if($phone): ?>
                                <div class="school-instrucrors-item-tel">
                                    <span><?php _e( 'tel', \PS::$theme_name ); ?>.</span> <?php echo $phone; ?>
                                </div>
                            <?php endif; ?>
                            <?php $address = get_field('address'); if($address): ?>
                                <div class="school-instrucrors-item-address">
