                                <?php $fb = get_field('fb'); if($fb): ?>
                                    <a href="<?php echo $fb; ?>" target="_blank">
                                        <img src="<?php echo \PS::$assets_url; ?>images/facebook.svg" alt="">
                                    </a>
                                <?php endif; ?>
                                <?php $in = get_field('in'); if($in): ?>
                                    <a href="<?php echo $in; ?>" target="_blank">
