                                    </a>
                                <?php endif; ?>
                            </div>
                        </div>
                        <?php $skills = get_field('skills'); if(is_array($skills) && count($skills)): ?>
                            <div class="school-instrucrors-item-region">
                                <span><?php _e( 'Skills', \PS::$theme_name ); ?></span>
                                <img src="<?php echo \PS::$assets_url; ?>images/arrow6.svg" alt="">
                            </div>
                            <div class="school-instrucrors-item-drop">
